import React from 'react';
import {connect} from "react-redux";
import { setName1, setName2 } from "../reducers/reducer";

const Game = props => {
        return (
            <div>
                <div>
                    <input value={props.name1} />
                </div>
                <div>
                    <input value={props.name2} />
                </div>
            </div>
        );
};

const mapStateToProps = (state) => ({
    name1: state.name1,
    name2: state.name2
});

const mapDispatchToProps = (dispatch) => ({
    setName1: () => (dispatch(setName1())),
    setName2: () => (dispatch(setName2()))
});

export default connect(mapStateToProps, mapDispatchToProps)(Game);
